import React from 'react';
import styled from 'styled-components';

const AboutSection = styled.section`
  padding: 60px 40px;
  background: #ffffff;
  display: flex;
  align-items: center;
  gap: 32px;
`;

const Image = styled.img`
  width: 50%;
  border-radius: 8px;
`;

const TextGroup = styled.div`
  flex: 1;
`;

const Title = styled.h3`
  font-size: 28px;
  color: #0a2239;
  margin-bottom: 16px;
`;

const Text = styled.p`
  font-size: 16px;
  line-height: 1.6;
  color: #333;
`;

export default function About() {
  return (
    <AboutSection id="about">
      <Image src="/images/family2.jpg" alt="Atendimento familiar" />
      <TextGroup>
        <Title>Sobre Nós</Title>
        <Text>
          No Neuropassos, acreditamos que o cuidado integra mente, corpo e relações familiares.
          Nossa equipe multidisciplinar oferece apoio especializado para todas as idades,
          garantindo um tratamento humanizado e orientado para resultados duradouros.
        </Text>
      </TextGroup>
    </AboutSection>
  );
}
